import styled from 'styled-components';
// Styles
const StyledFooter = styled.footer`
  width: 100%;
  padding: var(--padding-glob);
  @media (min-width: 960.5px) {
    display: none;
  } ;
`;

export const Footer = ({ children, ...args }) => {
  return <StyledFooter {...args}>{children}</StyledFooter>;
};
